import React from "react";
import Announcement from "./Announcement";
import Navbar from "./Navbar";
import Footer from "./Footer";


const Cart = () => {
    return (
            <div className="cart-container">
                <Navbar />
                <Announcement />
                <div className="cart-wrapper">
                <div >
                    <h1 className="cart-title">YOUR BAG</h1>
                </div>
                <div className="cart-top"></div>
                    <button className="btn-4">CONITUNE SHOPPING</button>
                    <div className="top-texts">
                        <span className="top-text">Shopping Bag(2)</span>
                        <span className="top-text">Your Wishlist(2)</span>
                    </div>
                    <button className="btn-4">CHECKOUT NOW</button>
                </div>
                <div className="cart-bottom"></div>
                <Footer />
            </div>

    )
}

export default Cart;
